import React from "react";
import { useLocation, useParams } from "react-router-dom";

const Contact = () => {
  const { name, lname } = useParams();
  const location = useLocation();
    console.log(location)
  return (
    <>
      <h1>
        Contact {name}
        {lname}
      </h1>
    </>
  );
};

export default Contact;
